import React,{Component} from 'react'
import { BrowserRouter,Switch, Route, Redirect} from 'react-router-dom';
import {IndexRoute} from 'react-router'
import {Details} from './patient_detials'
import {Vitals} from './patient_vitals'

export class Linker extends Component {
    // render(){
    //     return(
    //         <div className="container">
    //             <ul>
    //                 {/* <li>Home</li> */}
    //                 <li>Detials</li>
    //                 <li>Vitals</li>
    //             </ul>


    //         </div>
    //     )
    // }
    render(){
        return(
            <BrowserRouter>
        <Switch>
            <Route exact path="/Details" component={Details} />
            <Route exact path="/">
            <Redirect to="/Details" />
            </Route>
            <Route exact path="/About" component={Vitals} />
       </Switch>
       </BrowserRouter>
        )
    }
}
